import React from 'react';
import './Navbar.scss'

function Navbar() {
    return ( 

        <nav>
            <div className='logo'> Logo </div>
            <div className='links--nav'> 
            
            <ul>
                <li> Inicio </li>
                <li> Habilidades </li>
                <li> Experiencias </li>
                <li> Projetos </li>
                <li> Contatos </li>


            </ul>

             </div>
            <div className='button--darkmode'> Bot√£o Dark </div>
        </nav>

     );
}

export default Navbar;
